(5, 'August 2020 | Hospitality & Travel Connaisseur Magazine', 'The Debut issue of Hospitality &amp; Travel Connaisseur Magazine.', '<p><span xss=\"removed\"><b xss=\"removed\">The Debut issue of Hospitality & Travel Connaisseur Magazine.</b></span></p><p><span xss=\"removed\">Explore Happenings of Hospitality <b>under one-roof</b>. Hospitality <a href=\"https://community.hospitalityconnaisseur.com/category/news/\" target=\"_blank\">News</a>, <a href=\"https://community.hospitalityconnaisseur.com/category/learn-from-leaders/\" target=\"_blank\">Interviews </a>& <a href=\"https://community.hospitalityconnaisseur.com/category/magazine/\" target=\"_blank\">Stories</a>. The issue of August-2020.</span></p><p><span xss=\"removed\"><b>Now... What\'s in it for you?</b></span></p><ul><li><span xss=\"removed\">Explore a <b>first-of-its kind of initiative on Health, Hygiene and Safety </b>by ITC Hotels.</span></li></ul><ul><li><span xss=\"removed\">Explore one of the oldest and experienced company engaged in <b>Manufacturing and Supplying of Flora Sticks</b> for Hospitality Brands.</span></li></ul><ul><li><span xss=\"removed\"><b>ITC Grand Goa</b> - A luxury collection of Resort and Spa reopens by Adopting \'We Assure\' - A responsible luxury initiative.</span></li></ul><ul><li><span xss=\"removed\">An Informative study on <b>Single-Use Plastic and Tourism</b>!</span></li></ul><ul><li><span xss=\"removed\">The <b>Niraamaya Wellness Retreats</b> introduces Integrative and Functional Medicine Programs by <b>Daivam Wellness</b>.</span></li></ul><ul><li><span xss=\"removed\">Do Explore a Curated <b>Travelopedia of JAPAN</b> - A mythical country of diligent people.</span></li></ul><ul><li><span xss=\"removed\">Get to know \'<b>TOP 15 SOFT-SKILLS to master</b> as a Hospitality Professional\'</span></li></ul><ul><li><span xss=\"removed\">Exclusive Interview with <b>Mr. Prithvi Roy, Assistant Professor of Front Office</b> at WGSHA.</span></li></ul><ul><li><span xss=\"removed\"><b>ITC