(8, 'Food & Beverage Service | Academic Course', 'The Department looks after the Service of Food and Drinks, to the Guests in the Hotel or in any other Hospitality Establishment. Learn all about this department in Food &amp; Beverage Service Academic Course.', '<p><span xss=removed>Food & Beverage Service Academic Course</span><span xss=removed>by</span><a href=\"https://community.hospitalityconnaisseur.com/\">Hospitality Connaisseur</a><span xss=removed>is the Course to learn about the Food & Beverage Service Department. This Department looks after the Service of</span><a href=\"https://en.wikipedia.org/wiki/Restaurant\"><span xss=removed>Food and Drinks</span></a><span xss=removed>, to the Guests in the Hotel or in any other</span><a href=\"https://en.wikipedia.org/wiki/Hospitality\">Hospitality</a><span xss=removed>Establishment. Learn all about this department in Food & Beverage Service Academic Course.</span></p><p><br></p><div><span xss=removed><br></span></div>', '[\"Attributes of Waiter.\",\"Classification of Beverages.\",\"Process of Making Coffee.\",\"Food & Beverage Equipment.\",\"F&B Departmental Hierarchy.\",\"Type of Meals.\",\"Process of Restaurant Reservation.\",\"Meaning of Sideboard.\",\"Process of Making Tea.\",\"Job Description of Waiter.\"]', 'english', 1, 7, '[5]', '[\"If Food and Beverage Service is your Core Interest than This Course is for you! It will help you to Understand Core areas of F&B Service Department along with useful insights to Clear your Basics!\",\"Enroll now in this Food & Beverage Service \\u2013 Academic Course and start growing your knowledgebase! All about Hospitality.\"]', 799, 1, 399, 'intermediate', 1, NULL, '', 1618531200, 1618531200, 'general', 30, 1, 1, 'active', '', 'hospitality,food and beverage,online course,course,keynote course,food and beverage service online course,F&B Service Course,food knowledge,beverage knowledge,connaisseur,hospitality connaisseur,Attributes of Waiter,Classification of Beverages,Process 