(9, 'October 2020 | Hospitality & Travel Connaisseur Magazine', 'The Heritage Issue of Hospitality &amp; Travel Connaisseur Magazine.', '<p><span xss=\"removed\"><b>The Heritage Issue of Hospitality & Travel Connaisseur Magazine.</b></span></p><p><span xss=\"removed\">Explore Happenings of Hospitality</span><span xss=\"removed\">under one-roof</span><span xss=\"removed\">. Hospitality</span><a href=\"https://community.hospitalityconnaisseur.com/category/news/\" target=\"_blank\">News</a><span xss=\"removed\">,</span><a href=\"https://community.hospitalityconnaisseur.com/category/learn-from-leaders/\" target=\"_blank\">Interviews</a><span xss=\"removed\">&</span><a href=\"https://community.hospitalityconnaisseur.com/category/magazine/\" target=\"_blank\">Stories</a><span xss=\"removed\">. The issue of October-2020.</span></p><p><span xss=\"removed\">What\'s in it for you? <b>The Index.</b></span></p><ul><li><span xss=\"removed\"><b><a href=\"https://khirasarapalace.in/\" target=\"_blank\">HERITAGE KHIRASARA PALACE</a>: </b>The Majestic Monument of Khirasara, is now a Heritage Classic Hotel.</span></li><li><span xss=\"removed\"><b>SOMNATH TEMPLE</b>: Get to know the divine details of Shree Somnath Temple. #TravelReligious</span></li><li><font color=\"#3c4043\" face=\"Roboto, Arial, sans-serif\"><span xss=\"removed\"><b><a href=\"https://wankanerheritagehotels.com/\" target=\"_blank\">THE ROYAL OASIS HOTEL</a></b>: Travel there & embrace the majestic splendorof nature in its infinite glory!</span></font></li><li><font color=\"#3c4043\" face=\"Roboto, Arial, sans-serif\"><span xss=\"removed\"><b>DWARKADHISH TEMPLE</b>: Get to know the divine details of Shree Dwarkadhish Temple. #TravelReligious</span></font></li><li><font color=\"#3c4043\" face=\"Roboto, Arial, sans-serif\"><span xss=\"removed\"><b><a href=\"http://www.balarampalace.com/\" target=\"_blank\">BALARAM PALACE RESORT</a></b>: Once the hunting retreat of the Lohani Nawab of Palanpur, is now a Heritage Classic