(11, 'Food Production | Academic Course', 'All the Food and Beverages, that are served to the Hotel Guest are prepared in the kitchen under the Food and Beverage Production Department. You can learn more about this in this curated Food Production Academic Course.', '<p><span xss=removed>This</span><span xss=removed>Food Production Academic Course</span><span xss=removed>by</span><a href=\"https://community.hospitalityconnaisseur.com/\">Hospitality Connaisseur</a><span xss=removed>is the Online Course to learn about the</span><span xss=removed>Food & Beverage Production Department</span><span xss=removed>. All the Food and Beverages, that are served to the Hotel Guest are prepared in the kitchen under the Food and Beverage Production Department. You can learn more about this in this curated</span><span xss=removed>Food Production Academic Course</span><span xss=removed>.</span></p>', '[\"Basics of Bechamel Sauce.\",\"Cooking Materials.\",\"Cuts of Vegetables.\",\"Basics of Espagnole Sauce.\",\"A lesson about Fats & Oils.\",\"Basics of Hollandaise Sauce.\",\"Kitchen Utensils.\",\"Basics of Tomato Sauce.\",\"Basics of Veloute Sauce.\"]', 'english', 1, 8, '[9]', '[\"Are you an Aspiring Chef? Are you crazy about Culinary World? If yes than this course is for you!\"]', 0, NULL, 0, 'beginner', 1, NULL, '', 1618531200, 1618531200, 'general', 30, 1, 1, 'active', '', 'hospitality,connaisseur,online course,food production course,food production online course,hotel management,chef learning,kitchen education,connaisseur courses,hospitality connaisseur courses,food preparation ,kitchen training,Bechamel Sauce,Cooking Materials,Vegetables,Cuts of Vegetables,Espagnole Sauce,mother sauces,kitchen sauces,home made sauces,Fats & Oils,Hollandaise Sauce,kitchen train,Kitchen Utensils,Tomato Sauce,Veloute Sauce,sauce making online,hotel management free courses,hospitality free courses', 'This Food Production Academic Course by Hospitality Connaisseur is the Online Course to learn about the Food & Beverage Production Department.', 1),
(12, 'Front Office | Academic Course', 'The Front Office Department performs various functions like Reservation, Guest Assistance, Registration, Room Assignment and Settlement of Bills of a Resident Guest in general. You will learn about all these in this Front Office Academic Course.', '<p><span xss=removed>This is the</span><span xss=removed>Front Office Academic Course</span><span xss=removed>by</span><a href=\"https://community.hospitalityconnaisseur.com/\">Hospitality Connaisseur</a><span xss=removed>. The Front Office Department performs various functions like</span><span xss=removed>Reservation</span><span xss=removed>,</span><span xss=removed>Guest Assistance</span><span xss=removed>,</span><span xss=removed>Registration</span><span xss=removed>,</span><span xss=removed>Room Assignment</span><span xss=removed>and</span><span xss=removed>Settlement of Bills</span><span xss=removed>of a Resident Guest in general. You will learn about all these in this</span><span xss=removed>Front Office Academic Course</span><span xss=removed>.</span></p>', '[\"What is Cash Bank?\",\"Basics of Front Office Organization.\",\"Hotel Classification by Rooms.\",\"The lesson of Hotel Departments.\",\"Meal Plans of the Hotel.\",\"What is Night Auditor?\",\"Registration Process in the Hotel.\",\"Hotel Room Rates.\",\"Process of Tracking Room Availability.\",\"Types of Hotels.\"]', 'english', 1, 9, '[10]', '[\"If you are Interested in Leaning about Front Office Management and Its Everyday Tasks, than this course is for you! It will simply help you to clear your all doubts about Hotel Front Office in a quickest manner.\",\"The Front Office department of a Hotel comprise of various sections depending on the Size of the Hotel. The sections may vary in Small or Medium sized Hotels and The sections may be merged or handled accordingly asper the Standard Operating Procedure.\",\"Moreover, Front Office is one of the most important departments of the Hotel. The Manners, Responsibilities, People First Attitude and Effective Guest Management make the department unique. Mostly people think that working in Hotel Front Office is an easy task, but indeed it is not. Not as an Associate and Not as a Manager.\",\"It takes immense amount of Self Control and Skill to remain in the Department. And also High Commitment towards your work, Superior Communication & Impressive Knowledge is needed to be in the Team of Front Office of a Five Star Hotel.\",\"Enroll now in this Front Office \\u2013 Academic Course and start growing your knowledgebase! All about Hospitality.\"]', 0, NULL, 0, 'beginner', 1, NULL, '', 1618617600, 1618617600, 'general', 30, 1, 1, 'active', '', 'hospitality,hotel management,front office,front office course,online course,front office online course,online hotel management,hospitality online,front office department,connaisseur,hospitality connaisseur,free courses,free hotel management courses,free hospitality courses,cash bank,What is Cash Bank,Front Office Organization,Basics of Front Office Organization,Hotel Classification by Rooms,Hotel Departments,Meal Plans of the Hotel,What is Night Auditor,Registration Process in the Hotel,Hotel Room Rates,Process of Tracking Room Availability,Types of Hotels,free front office course', 'The Front Office Department performs various functions like Reservation, Guest Assistance, Registration, Room Assignment and Settlement of Bills of a Resident Guest in general. You will learn about all these in this Front Office Academic Course.', 1),
(13, 'Hotel Law | Academic Course', 'If you are Interested in Leaning about How does the Hotel Security Department works, What are the Laws and Legal Issues arise in Hospitality Businesses, than This Course is must for you!', '<p><span xss=removed>This is a</span><span xss=removed>Hotel Law Academic Course</span><span xss=removed>by</span><a href=\"https://community.hospitalityconnaisseur.com/\">Hospitality Connaisseur</a><span xss=removed>. The</span><a href=\"https://en.wikipedia.org/wiki/Hotel_detective\">Hotel Security</a><span xss=removed>is not always capable of detecting the bad elements and criminal activities sufficiently in advance to be able to Prevent them, Besides the Hotels also have various</span><span xss=removed>Laws, Acts and Licenses, that are Directly or Indirectly related to the Hotel business and need to be followed strictly</span><span xss=removed>, otherwise may attract many Problems.</span></p><p><br></p>', '[\"The law related to Hours of Working in Hospitality.\",\"Legal Issues in the Hospitality Industry.\",\"Smooth Conduct of Hospitality Business.\",\"Importance of Studying Hotel Law.\",\"Introduction to the Hotel Law.\",\"Law-related for Hospitality Business.\",\"Reasons for Refusal to Hotel Registration.\",\"Black Listing of Hotels.\",\"Law of Hotel Insurance.\",\"Principles of Labor Legislation.\"]', 'english', 1, 11, '[11]', '[\"If you are Interested in Leaning about How does the Hotel Security Department works, What are the Laws and Legal Issues arise in Hospitality Businesses, than This Course is must for you!\",\"To Learn more in this matter, Hospitality Industry involves varied Functions as Lodging and Catering are the Main Activities of the Hospitality Business, Relevant Laws covering its various functions naturally govern it, and It involves Service and hence has several Morals & Statutory obligations to be fulfilled.\",\"The Guest staying in the Hotel require looking after the Safety and Security of their belongings and lives.\",\"Various Clients come and stay and conduct their Business or Tourist activities in the Hotel and Restaurant premises, Being the venue to many Visitors the Hospitality organization naturally face many Problems not only from their Clients, but also from others, As it\\u2019s not always possible to check background of the Guests, there is always a Possibility of the misuse of Hotels by the Guest and attracting Attention of the Law, Here\\u2019s your chance to learn deep in this matter of Hotel Law.\",\"Enroll now in this Hotel Law \\u2013 Academic Course and start growing your knowledgebase! All about Hospitality.\"]', 0, NULL, 0, 'beginner', 1, NULL, '', 1618617600, 1618617600, 'general', 30, 1, 1, 'active', '', 'hospitality,connaisseur,online course,hotel law,law online course,hotel law online course,hotel industry,hotel management online,hotel education,hotel law education,free hotel management,free hotel management course,hotel law free course,hospitality connaisseur,The law related to Hours of Working in Hospitality,Legal Issues in the Hospitality Industry,Smooth Conduct of Hospitality Business,Importance of Studying Hotel Law,Introduction to the Hotel Law,Law-related for Hospitality Business,Reasons for Refusal to Hotel Registration,Black Listing of Hotels,Law of Hotel Insurance,Principles of Labor Legislation', 'If you are Interested in Leaning about How does the Hotel Security Department works, What are the Laws and Legal Issues arise in Hospitality Businesses, than This Course is must for you!', 1),
(14, 'Housekeeping | Academic Course', 'The Housekeeping Department is responsible for the Cleanliness, Maintenance, and Aesthetic upkeep of Rooms, Public Areas, Back Areas, and Surroundings in a Hotel. Enroll in this Course, and get to know the basics of the Hotel Housekeeping Department.', '<p><span xss=removed>This is the</span><span xss=removed>Housekeeping Academic Course</span><span xss=removed>by</span><a href=\"https://community.hospitalityconnaisseur.com/\">Hospitality Connaisseur</a><span xss=removed>. The Housekeeping Department is responsible for the</span><span xss=removed>Cleanliness, Maintenance, and Aesthetic upkeep of<a href=\"https://www.hospitalityconnaisseur.com/courses/front-office-academic-course/12\" target=\"_blank\">Rooms</a>, Public Areas, Back Areas, and<a href=\"https://en.wikipedia.org/wiki/Hotel\">Surroundings</a></span><span xss=removed>in a Hotel.</span></p>', '[\"Introduction of Housekeeping.\",\"Types & Sizes of Bed.\",\"Cleaning Agents.\",\"Usage of Chamber Maid\\u2019s Trolley.\",\"Functions of Housekeeping.\",\"Guest Room Supplies.\",\"Type of Rooms.\"]', 'english', 1, 10, '[12]', '[\"Do you want to work in the Housekeeping Department? Are your basics Clear? If not, than this course is just for you!\",\"Enroll in this Course, and get to know the basics of the Hotel Housekeeping Department.\",\"To learn more in this Matter, The Housekeeping department holds the Responsibility of Cleaning, Maintenance and Admirable upkeep of the Hotel. The main functions of Housekeeping are, Overall Cleanliness, Bed Making, Ensuring maintenance & infrastructure of the Property. The other functions also include Laundry & Linen Management, Key Control & Pest Control, Safety and Security of the Guests as well as the Infrastructure and Interior decoration of the Hotel Property.\",\"As The brief of all these functions can be found in this keynote course and also beneficial for learning.\",\"The Housekeeping Crew is responsible for Daily cleaning of Public Rooms, Private Bedrooms and Public area Washrooms. In addition, The department also handles Laundering of Linen and Guest laundry. Housekeeping also Performs minor security functions by providing a \\u201cFirst Alert\\u201d to potential guest problems while staff undertake Daily guest bedroom Cleaning. These all commonly overlooked yet important things will be discussed in this keynote course!\",\"Enroll now in this Housekeeping \\u2013 Academic Course and start growing your knowledgebase! All about Hospitality.\"]', 0, NULL, 0, 'beginner', 1, NULL, '', 1618617600, 1618617600, 'general', 30, 1, 1, 'active', '', 'hotel,hotel management,hotel housekeeping,housekeeping,hospitality,connaisseur,hospitality connaisseur,free hotel management,hotel management courses,hotel housekeeping course,housekeeping course,free housekeeping course,Introduction of Housekeeping,Types & Sizes of Bed,Cleaning Agents,Usage of Chamber Maids Trolley,Functions of Housekeeping,Guest Room Supplies,Type of Rooms,hospitality connaisseur courses,connaisseur courses', 'The Housekeeping Department is responsible for the Cleanliness, Maintenance, and Aesthetic upkeep of Rooms, Public Areas, Back Areas, and Surroundings in a Hotel. Enroll in this Course, and get to know the basics of the Hotel Housekeeping Department.', 1),
(15, 'December 2020 | Hospitality & Travel Connaisseur Magazine', 'Explore the Trending Articles and Studies on Cuisines, Food Information, Travelopedia and many more interesting reading in this dedicated issue!', '<p><span xss=removed><b>The FoodFood Issue (December 2020) of Hospitality & Travel Connaisseur Magazine has been launched.</b></span></p><p><span xss=removed>Explore the Trending Articles and Studies on Cuisines, Food Information, Travelopedia and many more interesting reading in this dedicated issue! Don\'t miss out.</span></p><p><span xss=\"removed\" xss=removed>Explore Happenings of Hospitality</span><span xss=\"removed\" xss=removed>under one-roof</span><span xss=\"removed\" xss=removed>. Hospitality</span><a href=\"https://community.hospitalityconnaisseur.com/category/news/\" target=\"_blank\">News</a><span xss=\"removed\" xss=removed>,</span><a href=\"https://community.hospitalityconnaisseur.com/category/learn-from-leaders/\" target=\"_blank\">Interviews</a><span xss=\"removed\" xss=removed>&</span><a href=\"https://community.hospitalityconnaisseur.com/category/magazine/\" target=\"_blank\">Stories</a><span xss=\"removed\" xss=removed>. The issue of December-2020.</span></p><h4><span xss=\"removed\" xss=removed>THE INDEX</span></h4><p><p><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed><b>KNOW THE ICON</b> : Journey of <b>Mr. Ranjitdan Gadhvi</b>. Managing Director of Shivam Marketing.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed><b>The Journey of Tea</b> becoming a daily affair! Get to know it\'s all historical details.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed>A Study on Farming using less water. AQUACULTURE + HYDROPONICS = <b>AQUAPONICS</b>.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed><b>Travelopedia of France</b> : A Country of the combination of Art and Revolution.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed><b>Treasury of Indian Cuisine</b>. An Exclusive Article.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed>Molecular Gastronomy.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed><b>Learn from Leaders</b> : Interview of <b>Mr. Rahul Chowdhury</b>, Assistant Professor of F&B Service at Sister Nivedita University.</span></font></li></ul><ul><li><font color=\"#29303b\" face=\"Inter\"><span xss=removed>Emergence of New <b>Nordic Cuisine</b> : The total Nordic Food Manifesto.</span></font></li></ul></p></p><p><br></p>', '[]', 'english', 3, 40, '[13]', '[]', 0, NULL, 0, NULL, 1, NULL, '', 1618617600, 1618704000, 'magazine', 999999, 1, 1, 'active', '', 'connaisseur,hospitality,travel,e-magazine,online magazine,free magazine,hotel magazine,hospitality and travel connaisseur magazine,connaisseur magazine,December 2020 ,online magazine issue,shivam marketing,journey of tea,tea process,types of tea,aquaponics,less water farming,aquaponics farming,indian cuisine,treasury,treasury of indian cuisine,molecular gastronomy,gastronomy,science behind cuisine,learn from leaders,food and beverage service,rahul chowdhury,sister nivedita university,nordic cuisine,nordic cuisine manifesto,manan chakraborty,salla vijay kumar,rudra soni,manvendra singh gohil', 'Explore the Trending Articles and Studies on Cuisines, Food Information, Travelopedia and many more interesting reading in this dedicated issue!', 1),
