tion of the Future, For the City of the Future.</span></font></li></ul><ul><li><font color=\"#3c4043\" face=\"Roboto, Arial, sans-serif\"><span xss=removed><b>Coronavirus & Global Tourism </b>: An Ugly affair! Must Read curated story.</span></font></li></ul><ul><li><font color=\"#3c4043\" face=\"Roboto, Arial, sans-serif\"><span xss=removed>List of Services which may decide<b> if Guest will return </b>to your hotel again!</span></font></li></ul><ul><li><font color=\"#3c4043\" face=\"Roboto, Arial, sans-serif\"><span xss=removed><b>Foodie Capitals</b> : A detailed study of Indian Cuisine.</span></font></li></ul><p></p><p></p>', '[]', 'english', 3, 40, '[14]', '[]', 0, NULL, 0, NULL, 1, NULL, '', 1618704000, 1618704000, 'magazine', 999999, 1, 1, 'active', '', 'hospitality,connaisseur,hospitality connaisseur,e-magazine,free magazine,hospitality magazine,hotel magazine,food magazine,connaisseur magazine,hospitality and travel connaisseur magazine,shivam marketing,welcomhotel shimla,itc hotels,travelopedia,iran travel,travel iran,iran tourism,research in hospitality,spirulina,spirulina nutrition,corona,coronavirus,tourism industry,tourism and corona,coronavirus and global tourism,hotel services for guest,foodie capitals,shantanu jain hospitality,manan chakraborty,vivek salhotra,soumyadeep roy,salla vijay kumar,manvendra singh gohil,rudra soni', 'Explore The Latest Happenings of Indian Hospitality Industry along with Curated Travelopedia of IRAN and other Informative Articles written by Industry Experts. Let\'s Dive Into the details!', 1);
