INSERT INTO `faqs` (`id`, `question`, `answer`, `status`) VALUES
(1, 'sample quest?', 'sjdbjhsgdbaj', 0),
(2, 'What is Hotel Management?', 'While you may have stayed in several hotels before, but... you may have never wondered, What is hotel management? Well, Hospitality Management is a broader, more general definition that covers hotel management as well as management at other businesses that provide services such as food and beverage, travel, and other businesses that serve both vacation and business travelers.\r\n\r\nWhile hotel management programs may focus mainly on how to manage a hotel, and its departments, and its staff, hospitality management courses may branch out into food services, travel, and business management courses.', 0),
(3, 'What is Hospitality Connaisseur?', 'Hospitality Connaisseur  Accelerating Hospitality, Empowering Hoteliers. Indias 1st Hospitality centric Media and Technology Company, believes to connect each hospitality individual to the vast & various amount of knowledge by providing Boost, Backup and Motivation for their professional growth journey via Online Courses, Magazines, Podcasts, News and Daily relevant Articles on The Hospitality Industry. Start learning the modern way!\r\n\r\nMission: To be the Souvenir for our Hospitality Industry with the Finest Informative Content.\r\nVision: To be the Premium Real-time Educational Source of Indian Hotel & Tourism Industry by providing remarkable profit to our Subscribers and Clients.', 0),
(4, 'What are some typical Hospitality Management Courses?', 'Whether youre planning on pursuing an associates or a bachelors degree in hospitality management, your courses will vary from program to program. Some hospitality management courses you may take in order to earn an associates degree in hospitality management include: Fundamental Hospitality Management Principles, Technology in the Hospitality Management Industry, Convention and Event Management, Accounting Principles, Employment Law or A bachelor degree program may also teach you the fundamentals, but also move into more technical or specific areas of hospitality management. Some courses you may take in order to earn a bachelors degree in hospitality management includes Integrated Marketing Communications, Applied Business Ethics, Hospitality Law & Legal Issues, Applied Accounting and Finance, with Integrated Marketing Communications.', 0),
(5, 'What Courses does www.hospitalityconnaisseur.com offer?', 'Well, Hospitality Connaisseur is a Total Solution for your knowledge needs! We cover Hotel Management, Tourism Management and Aviation Management with their syllabus converted into knowledge enriched Online Courses (Videos). Our Online Courses are not just another online courses! We are Industry Experts, bring you the most relevant Online Courses made with the help of Edutainment, which is a mix of Education & Entertainment. Our Courses wont bore you! If you had a hard working day or a boring college day, Get into our Curated and Comprehensive online courses and calm your appetite for knowledge. We simply provide Digitally Comprehensive Learning & Development with Effective Training Management.', 0),
(6, 'What Courses does www.hospitalityconnaisseur.com offer?', 'Well, Hospitality Connaisseur is a Total Solution for your knowledge needs! We cover Hotel Management, Tourism Management and Aviation Management with their syllabus converted into knowledge enriched Online Courses (Videos). Our Online Courses are not just another online courses! We are Industry Experts, bring you the most relevant Online Courses made with the help of Edutainment, which is a mix of Education & Entertainment. Our Courses wont bore you! If you had a hard working day or a boring college day, Get into our Curated and Comprehensive online courses and calm your appetite for knowledge. We simply provide Digitally Comprehensive Learning & Development with Effective Training Management.\r\n\r\nWe have a collection of Free and Paid Courses to choose from. You can also find Courses made by Top Hospitality Faculties and Mentors, to learn from their perspective! You can also explore community.hospitalityconnaisseur.com to get a free knowledgebase, which has Relevant Articles, Podcasts and Latest NEWS on Indian Hospitality Segment.\r\n\r\nMoreover, We also publish a Monthly Hospitality centric Magazine called Hospitality & Travel Connaisseur Magazine ; An E-Magazine, brings you the trends of Hotel, Tourism and Aviation Industry with Detailed Industry Insights. News | Interviews | Stories at the most affordable price!', 0),
(7, 'What is Hotel Management?', '<p><span id=\"docs-internal-guid-3dc01e27-7fff-e316-df9b-c565ac4ed125\"><span xss=removed>While you may have stayed in several hotels before, but... you may have never wondered, What is hotel management? Well, Hospitality Management is a broader, more general definition that covers hotel management as well as management at other businesses that provide services such as food and beverage, travel, and other businesses that serve both vacation and business travelers.</span></span></p><p><span id=\"docs-internal-guid-3dc01e27-7fff-e316-df9b-c565ac4ed125\"><span xss=removed><span id=\"docs-internal-guid-e0231e4a-7fff-3898-708b-442ec847b271\"><span xss=removed>While hotel management programs may focus mainly on how to manage a hotel, and its departments, and its staff, hospitality management courses may branch out into food services, travel, and business management courses.</span></span><br></span></span></p>', 1),
(8, 'What is Hospitality Connaisseur?', '<span id=\"docs-internal-guid-207b32f8-7fff-54fc-2d3a-227aa094c0b5\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b>Hospitality Connaisseur</b>  Accelerating Hospitality, Empowering Hoteliers. Indias 1st Hospitality centric Media and Technology Company, believes to connect each hospitality individual to the vast & various amount of knowledge by providing Boost, Backup and Motivation for their professional growth journey via Online Courses, Magazines, Podcasts, News and Daily relevant Articles on The Hospitality Industry. Start learning the modern way!</span></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\" xss=removed><b>Mission:</b></span><span xss=\"removed\" xss=removed> To be the Souvenir for our Hospitality Industry with the Finest Informative Content.</span><br></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><span id=\"docs-internal-guid-473c7fa9-7fff-7812-9899-8477d5ac928b\"></span></span></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\" xss=removed><b>Vision:</b></span><span xss=\"removed\" xss=removed> To be the Premium Real-time Educational Source of Indian Hotel & Tourism Industry by providing remarkable profit to our Subscribers and Clients.</span><br></p></span>', 1),
(9, 'What are some typical Hospitality Management Courses?', '<p><span id=\"docs-internal-guid-bfd8bbf8-7fff-d5b4-2061-d89f0d136720\"><span xss=removed>Whether youre planning on pursuing an associates or a bachelors degree in hospitality management, your courses will vary from program to program.</span></span></p><p><span id=\"docs-internal-guid-bfd8bbf8-7fff-d5b4-2061-d89f0d136720\"><span xss=removed>Some hospitality management courses you may take in order to earn an associates degree in hospitality management include: Fundamental Hospitality Management Principles, Technology in the Hospitality Management Industry, Convention and Event Management, Accounting Principles, Employment Law or A bachelor degree program may also teach you the fundamentals, but also move into more technical or specific areas of hospitality management.</span></span></p><p><span id=\"docs-internal-guid-bfd8bbf8-7fff-d5b4-2061-d89f0d136720\"><span xss=removed>Some courses you may take in order to earn a bachelors degree in hospitality management includes Integrated Marketing Communications, Applied Business Ethics, Hospitality Law & Legal Issues, Applied Accounting and Finance, with Integrated Marketing Communications.</span></span>\r\n                        \r\n                        </p>', 1),
(10, 'What Courses does www.hospitalityconnaisseur.com offer?', '<p><span id=\"docs-internal-guid-4253364d-7fff-1050-4bd8-eed3f86a7dd6\"><span xss=removed>Well, Hospitality Connaisseur is a Total Solution for your knowledge needs! We cover Hotel Management, Tourism Management and Aviation Management with their syllabus converted into knowledge enriched Online Courses (Videos). Our Online Courses are not just another online courses! We are Industry Experts, bring you the most relevant Online Courses made with the help of Edutainment, which is a mix of Education & Entertainment. Our Courses wont bore you! If you had a hard working day or a boring college day, Get into our Curated and Comprehensive online courses and calm your appetite for knowledge. We simply provide Digitally Comprehensive Learning & Development with Effective Training Management.</span></span></p><p><span id=\"docs-internal-guid-4253364d-7fff-1050-4bd8-eed3f86a7dd6\"><span xss=removed><span id=\"docs-internal-guid-f0a89d18-7fff-97ad-7824-f5b91922bb41\"><span xss=removed><b>We have a collection of Free and Paid Courses to choose from. You can also find Courses made by Top Hospitality Faculties and Mentors, to learn from their perspective! You can also explore <a href=\"http://community.hospitalityconnaisseur.com\" target=\"_blank\">community.hospitalityconnaisseur.com</a> to get a free knowledgebase, which has Relevant Articles, Podcasts and Latest NEWS on Indian Hospitality Segment.</b></span></span></span></span></p><p><span id=\"docs-internal-guid-4253364d-7fff-1050-4bd8-eed3f86a7dd6\"><span xss=removed><span id=\"docs-internal-guid-f0a89d18-7fff-97ad-7824-f5b91922bb41\"><span xss=removed><span id=\"docs-internal-guid-fcf010f2-7fff-b72a-c377-08703a3e37f2\"><span xss=removed>Moreover, We also publish a Monthly Hospitality centric Magazine called Hospitality & Travel Connaisseur Magazine ; An E-Magazine, brings you the trends of Hotel, Tourism and Aviation Industry with Detailed Industry Insights. News | Interviews | Stories at the most affordable price!</span></span></span></span></span></span></p><p>\r\n                        \r\n                        </p>', 1),
(11, 'How is www.hospitalityconnaisseur.com different from other platforms?', '<span id=\"docs-internal-guid-7d986fe7-7fff-10ef-c01d-082089af532b\"><span xss=removed>Well, We are Focused on the Grassroot approach! It means that we are focused on the development of Hospitality Students, Fresher and Executives, to provide them with the most relevant or Industry needed knowledge / skill-sets with the help of our curated offerings. Clearly stated in our Vision Statement. In Short Thinking Hospitality? Think Hospitality Connaisseur.</span></span>', 1),
(12, 'What are the Offerings?', '<ul><li><span id=\"docs-internal-guid-12060f3f-7fff-6474-7437-bcb83478ce5d\"><span xss=\"removed\">Animated Online Courses as per Syllabus made by Hospitality Connaisseur</span></span></li><li><span id=\"docs-internal-guid-12060f3f-7fff-6474-7437-bcb83478ce5d\"><span xss=\"removed\"><span id=\"docs-internal-guid-ecf9a8a9-7fff-8a26-41b6-198fa9e46f1d\"><span xss=\"removed\">Online Courses made by Top Hospitality Faculties and Mentors</span></span></span></span></li><li><span id=\"docs-internal-guid-12060f3f-7fff-6474-7437-bcb83478ce5d\"><span xss=\"removed\"><span id=\"docs-internal-guid-ecf9a8a9-7fff-8a26-41b6-198fa9e46f1d\"><span xss=\"removed\"><span id=\"docs-internal-guid-d43063ec-7fff-a0ee-c5b4-b687b9a0ec8a\"><span xss=\"removed\">Education based a Monthly Hospitality & Travel Connaisseur Magazine</span></span></span></span></span></span></li><li><span id=\"docs-internal-guid-12060f3f-7fff-6474-7437-bcb83478ce5d\"><span xss=\"removed\"><span id=\"docs-internal-guid-ecf9a8a9-7fff-8a26-41b6-198fa9e46f1d\"><span xss=\"removed\"><span id=\"docs-internal-guid-d43063ec-7fff-a0ee-c5b4-b687b9a0ec8a\"><span xss=\"removed\"><span id=\"docs-internal-guid-ddadb940-7fff-c3fb-1fc4-cd211495e535\"><span xss=\"removed\">Free knowledgebase, which includes daily NEWS, Articles, Podcasts and All Hospitality Management Colleges Ratings & Reviews!</span></span></span></span></span></span></span></span><br></li></ul>', 1),
(13, 'Do I need to earn a Hospitality Management certificate or degree to pursue a career in the Industry?', '<p><span id=\"docs-internal-guid-dd052d8d-7fff-0c0c-4ff7-d92ad3edb777\"><span xss=removed>While Hospitality Management certificate programs exist, most large, full-service hotels and resorts require hospitality managers orapplicants to have a bachelors degree in hospitality or hotel management. At hotels that are smaller or provide fewer services, a candidate with an associates degree or a hotel management, restaurant management, or hospitality management certificate may be considered as candidates.</span></span></p><p><b><span id=\"docs-internal-guid-dd052d8d-7fff-0c0c-4ff7-d92ad3edb777\"><span xss=removed>Start Learning on </span></span><a href=\"http://www.hospitalityconnaisseur.com\" target=\"_blank\">www.hospitalityconnaisseur.com</a><span id=\"docs-internal-guid-dd052d8d-7fff-0c0c-4ff7-d92ad3edb777\"><span xss=removed> and learn everything about your field of interest and get a Certificate too!</span></span></b></p>', 1),
(14, 'Does Hospitality Connaisseur provide me a Certificate after completion of Online Course?', '<span id=\"docs-internal-guid-311daa7e-7fff-44b3-3093-b4574f9618fe\"><span xss=removed>Yes, We do provide a Shield Certificate and a Medal on the Completion of Our Syllabus wise Online Courses, The Shield Certificate and Medal will be sent to you on your Respective Stay Address. Moreover, If you complete Online Courses made by Top Hospitality Faculties or Mentors on our Website then you will receive a Soft Copy of the certificate after Course Completion.</span></span>', 1),
(15, 'Are there Hospitality Management Internship programs?', '<span id=\"docs-internal-guid-af47d6bf-7fff-09d4-ca0d-819a08d9f8bb\"><span xss=removed>Well, We do not provide any Internship Programs yet but Yes! A hospitality management internship may help you gain experience in the hospitality industry and help you decide what area of hospitality management you may want to focus on. Internships often offer on-the-job training and sometimes participation in staff meetings or company initiatives. Many large hotel chains offer internships and, if the company to which you are applying for an internship is global, they may have exciting internship opportunities for qualified applicants in other countries. Please keep in mind that compensation, work permits, and benefits vary by company, by country, and by internship.</span></span>', 1),
(16, 'What Makes A Student Successful In This Program?', '<span id=\"docs-internal-guid-ac3327ba-7fff-4f11-3583-e6197b55113f\"><span xss=removed>Successful students, beyond being actively involved in the theory or practicals, and have good academic results, are involved in the hospitality industry. Through this program they have the opportunity to learn a vast amount of skills as per their field of interest and convenience. Successful students demonstrate strong communication (writing and speaking), as well as excellent interpersonal, teamwork and leadership skills which are being actively taught in all the courses of Hospitality Connaisseur, whether They are our Animated Courses or The Courses prepared by Top Hospitality Faculties or Mentors. As we prefer to provide quality content!</span></span>', 1),
(17, 'Why Do I Have To Study So Many Subjects In Hotel Management?', '<span id=\"docs-internal-guid-73d06589-7fff-bac1-c5a9-379c09068712\"><span xss=removed>The ultimate aim of the course is to enable the candidate / student to reach the top position in the Hotel industry. As a General Manager he/she is required to know the basics of hotel engineering, food laws, hotel accounting, nutritional facts, computer applications and be flexible to information and relevant trends. So besides the core subjects, the candidate must be in a position to grasp and understand the importance of additional or ancillary topics. Along with The Daily Happenings of Hospitality too!</span></span>', 1),
(18, 'Can I choose the Faculty / Mentor who I want to learn from?', '<span id=\"docs-internal-guid-1fa08bfb-7fff-9cd1-6c23-cf8035dea5c5\"><span xss=removed>Well Our courses will help you learn all the concepts from the Top Hospitality Faculties and Mentors in the country. Simply, Search the Course Topic and Click on the name of the Instructor, Visit their profile and Read their Bio. If you find them relevant then Purchase their Course and start learning!</span></span>', 1),
(19, 'What if I need help to select a course?', '<span id=\"docs-internal-guid-f1eace47-7fff-f0ef-7487-5bb544cfae74\"><span xss=\"removed\">You can always request the Hospitality Connaisseur Team to select the best courses for you. All you have to do is to call or WhatsApp the number (<a href=\"http://wa.me/919998758934\" target=\"_blank\">+91 999-875-8934</a>) stated on the platform, and our team will be more than happy to assist you.</span></span>', 1),
(20, 'How can I clear my doubts instantly during the course?', '<p>\r\n                                                    <span id=\"docs-internal-guid-f09f480d-7fff-ef3a-d2b1-d6b848968397\"><span xss=\"removed\">While attending an online course, you can ask your questions in our platforms <b>chatbot</b>, by our specially assigned associate who will instantly assist as well as solve your doubts. The same goes for the doubts related to our other offerings.</span></span></p><p><span id=\"docs-internal-guid-f09f480d-7fff-ef3a-d2b1-d6b848968397\"><span xss=\"removed\"><span id=\"docs-internal-guid-898bad5a-7fff-bb9e-a32f-e4cf36b19e90\"><span xss=removed>Got more questions? Feel free to write to us on </span><a href=\"mailto:support@hospitalityconnaisseur.com\"><span xss=removed>support@hospitalityconnaisseur.com</span></a><span xss=removed> or call on +91 999-875-8934 to get instant assistance!</span></span><br></span></span>                        \r\n                        </p>', 1);
