(4, 'about_us', '<section>\r\n    <div class=\"container py-5\">\r\n        <h2 class=\"text-center py-5 font-weight-bold\"> HOTELS | TOURISM | AVIATION | EDUCATION</h2>\r\n        <h3 class=\"text-center py-3 font-weight-bold\"> \"Accelerating Hospitality\"</h3>\r\n        <h3 class=\"text-center py-3 font-weight-bold\">We are already Proud to be the Indias First Hospitality Specific Digital Learning and Hospitality centric Magazine Start-up Brand.</h3>\r\n        <div class=\"font-inter lead\">\r\n            <p><i class=\"far fa-thumbs-up text-theme\"></i> hospitalityconnaisseur.com is Media and Technology Company, Who has Hospitality Domain Expertise. As the Companys core is Hospitality Centric and Fully Committed towards the Development of Hospitality Individuals, Institutions and Organizations.</p>\r\n            <p><i class=\"far fa-thumbs-up text-theme\"></i> Here, The Company believes to Accelerate the Hospitality Industry with the Help of Digitally Comprehensive Edutainment by using Finest Technology Possible.</p>\r\n            <p><i class=\"far fa-thumbs-up text-theme\"></i> As per their Working Modules, The Technology Unit is the Digital Segment Focused on Providing Knowledge Enriched Hospitality Management Online Courses as a Learning Solution to all the Hospitality Enthusiasts for their Learning and Development\r\n                Needs.\r\n            </p>\r\n            <p><i class=\"far fa-thumbs-up text-theme\"></i> Whereas, The Media Unit is Focused on Publishing a Monthly Hospitality centric Magazine, to Distribute Insider Insights to all the Hospitality Individuals and Organizations.</p>\r\n    </div>\r\n    </div>\r\n    <div class=\"bg-gradient p-5\">\r\n        <h2 class=\"text-center pb-5 font-weight-bold\">\"WHAT WE BELIEVE\"</h2>\r\n        <h3 class=\"text-center \">We believe to accelerate the Indian Hospitality Industry with the help of Digitally comprehensive Edutainment by using finest Technology possible.</h3>\r\n    </div>\r\n    <div class=\"container-fluid py-5\">\r\n        <h2 class=\"text-center pb-5 font-weight-bold\">\"OUR STATEMENT\"</h2>\r\n        <div class=\"row text-center\">\r\n            <div class=\"col-12\">\r\n                <h3 class=\"font-weight-bold\">MISSION</h3>\r\n                <p>To be the Souvenir for our Hospitality Industry with the Finest Informative Content.</p>\r\n            </div>\r\n            <div class=\"col-12\">\r\n                <h3 class=\"font-weight-bold\">VISION</h3>\r\n                <p>To be the Premium Real-time Educational Source of Indian Hotel & Tourism Industry by providing remarkable profit to our Subscribers and Clients.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"py-5 container-fluid bg-dark text-white\">\r\n        <h2 class=\"text-center pb-5 font-weight-bold text-white\">\"WHAT WE OFFER\"</h2>\r\n        <div class=\"row text-center\">\r\n            <div class=\"col-12\">\r\n                <h3 class=\"font-weight-bold text-white\">Hospitality E-Learning facility\r\n                </h3>\r\n                <p>hospitalityconnaisseur.com</p>\r\n            </div>\r\n            <div class=\"col-12\">\r\n                <h3 class=\"font-weight-bold text-white\">An Educational Magazine\r\n                </h3>\r\n                <p>Hospitality & Travel Connaisseur Magazine</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <div class=\"p-5\">\r\n        <h2 class=\"text-center pb-5 font-weight-bold\">\"OUR PHILOSOPHY\"</h2>\r\n        <h3 class=\"text-center \">The Core of Hospitality Connaisseur is to connect each Hospitality individual to the Vast & Various amount of Knowledge by providing Boost, Backup and Motivation for their Professional Growth Journey.</h3>\r\n    </div>\r\n</section>');
