(11, 'privacy_policy', '<p></p>\r\n<h1 xss=\"removed\"><span id=\"docs-internal-guid-bc62b1ba-7fff-7456-f2f6-5d511cccb6f5\"><span xss=\"removed\">WEBSITE Privacy Policy.</span></span>\r\n</h1>\r\n<p xss=\"removed\"><span id=\"docs-internal-guid-bc62b1ba-7fff-7456-f2f6-5d511cccb6f5\"><span xss=\"removed\"></span></span>\r\n</p>\r\n<h3 xss=\"removed\">Updated : 12 April, 2021</h3>\r\n<p></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">CONNAISSEUR FUTURETECH PRIVATE LIMITED, of Surat, Gujarat, India (referred to as Company, we or us), provides the HospitalityConnaisseur.com The Website located at www.hospitalityconnaisseur.com and their all subdomains - mobile and desktop apps (collectively, the Website), subject to your compliance with all the terms, conditions and notices contained or referenced herein (the, Policy). In addition, when subscribing or buying the certain services from the Website, users will be subject to additional rules applicable to such services.</span></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b>BY USING THE WEBSITE, YOU INDICATE THAT YOU ACCEPT THE POLICY AND THAT YOU AGREE TO ABIDE BY IT. YOUR REMEDY FOR DISSATISFACTION WITH THE WEBSITE OR ITS CONTENTS IS TO STOP USING THE WEBSITE.</b></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b><br></b></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The User data provided to www.hospitalityconnaisseur.com is Safe and will not be sold to any third party for Monetary benefits.</span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-2c96cc65-7fff-e085-50ab-7454282b1f3e\"><br></b></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The Company, Connaisseur Futuretech Private Limited uses the Data in order to stay connected with their Clients & Subscribers.</span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">If you have any Concern or Queries then Please feel free to Contact us on our Email at </span><a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a>\r\n        <span xss=\"removed\"> and We will be happy to assist!</span>\r\n    </p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Thank you for choosing to be part of our community at Connaisseur Futuretech Private Limited (https://www.hospitalityconnaisseur.com) (Company, we, us, or our). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our policy, or our practices with regards to your personal information, please contact us at </span>\r\n        <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a><span xss=\"removed\">.</span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">When you visit our website </span><a class=\"text-theme\" href=\"https://www.hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">https://www.hospitalityconnaisseur.com</span></a><span xss=\"removed\"> and use our services, you trust us with your personal information. We take your privacy very seriously. In this privacy policy, we seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it.</span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy policy that you do not agree with, please discontinue use of our Sites or Apps and our services.</span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">This privacy policy applies to all information collected through our websites (such as </span><a class=\"text-theme\" href=\"https://www.hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">www.hospitalityconnaisseur.com</span></a>\r\n            <span xss=\"removed\"> and all other subdomains, or any related services, sales, marketing or events (we refer to them collectively in this privacy policy as the Services).</span>\r\n        </p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Please read this privacy policy carefully as it will help you make informed decisions about sharing your personal information with us.</span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n        <h3 xss=\"removed\"><span xss=\"removed\">1. WHAT INFORMATION DO WE COLLECT?</span></h3>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-14db004f-7fff-aee6-cffb-140802c6b620\"><br></b></span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Personal information you disclose to us. In Short : We collect personal information that you provide to us such as name, address, contact information, passwords and security data, payment information, and social media login data.</span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We collect personal information that you voluntarily provide to us when registering at the Services, expressing an interest in obtaining information about us or our products and services, when participating in activities on the Services (such as posting messages in our online forums or entering competitions, awards, contests or giveaways) or otherwise contacting us.</span></p>\r\n            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The personal information that we collect depends on the context of your interactions with us and the Services, the choices you make and the products and features you use. The personal information we collect can include the following:</span></p>\r\n                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Publicly Available Personal Information : We collect first name, middle name, last name, and nickname; phone numbers; email addresses; business email; and other similar data.</span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Personal Information Provided by You : We collect website/app usage; financial information (credit card number, purchase history, invoices); purchase history; and other similar data.</span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Credentials : We may collect passwords, password hints, and similar security information used for authentication and account access.</span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Payment Data : We collect data necessary to process your payment if you make purchases, such as your payment instrument number (such as a card number), and the security code associated with your payment instrument. As Hospitality Connaisseur offers you multiple payment methods. Our Payment gateway partners use secure encryption technology to keep your transaction details confidential at all times or You may use Internet Banking, Wallet and QR Support to make your purchase.</span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Social Media Login Data : We may provide you with the option to register using social media account details, like your Facebook, Twitter or other social media account. If you choose to register in this way, we will collect the Information described in the section called HOW DO WE HANDLE YOUR SOCIAL LOGINS below.</span></p>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.</span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Information automatically collected. In Short : Some information - such as IP address and/or browser and device characteristics - is collected automatically when you visit our Services.</span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We automatically collect certain information when you visit, use or navigate the Services, This information does not reveal your specific identity (like your name or contact information) but may include device and usage information, such as your IP address, browser and device characteristics, operating system, language preferences, referring URLs, device name, country, location, information about how and when you use our Services and other technical information. This information is primarily needed to maintain the security and operation of our Services, and for our internal analytics and reporting purposes.</span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Like many businesses, we also collect information through cookies and similar technologies.</span></p>\r\n                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Online Identifiers : We collect devices; applications; tools and protocols, such as IP (Internet Protocol) addresses; cookie identifiers, or others such as the ones used for analytics and marketing; devices geolocation; and other similar data.</span></p>\r\n                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Push Notifications : We may request to send you push notifications regarding your account or the mobile application. If you wish to opt-out from receiving these types of communications, you may turn them off in your devices settings.</span></p>\r\n                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We might have and collect your data i.e. Your Name, Email Address, Contact Number, Work Place, Designation, if you are connected with us on any social networks. (In order to provide you relevant information)</span></p>\r\n                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                            <h3 xss=\"removed\"><span xss=\"removed\">2. HOW DO WE USE YOUR INFORMATION?</span></h3>\r\n                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">In Short : We process your information for purposes based on legitimate business interests, the fulfillment of our contract with you, compliance with our legal obligations, and/or your consent.</span></p>\r\n                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We use personal information collected via our Services for a variety of business purposes described below. We process your personal information for these purposes in reliance on our legitimate business interests, in order to enter into or perform a contract with you, with your consent, and/or for compliance with our legal obligations. We indicate the specific processing grounds we rely on next to each purpose listed below.</span></p>\r\n                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We use the information we collect or receive : To facilitate account creation and login process. If you choose to link your account with us to a third party account (such as your Google or Facebook account), we use the information you allowed us to collect from those third parties to facilitate account creation and logon process for the performance of the contract.</span></p>\r\n                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">See the section below headed HOW DO WE HANDLE YOUR SOCIAL LOGINS for further information : To send you marketing and promotional communications. We and/or our third party marketing partners may use the personal information you send to us for our marketing purposes, if this is in accordance with your marketing preferences.</span></p>\r\n                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">You can opt-out of our marketing emails at any time (see the WHAT ARE YOUR PRIVACY RIGHTS here : To send administrative information to you. We may use your personal information to send you product, service and new feature information and/or information about changes to our terms, conditions, and policies.</span></p>\r\n                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Fulfill and manage your orders : We may use your information to fulfill and manage your orders, payments, returns, and exchanges made through the Services or Apps.</span></p>\r\n                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To post testimonials : We post testimonials on our Services or Apps that may contain personal information. Prior to posting a testimonial, we will obtain your consent to use your name and testimonial. If you wish to update, or delete your testimonial, please contact us at </span>\r\n                                                                    <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a><span xss=\"removed\"> and be sure to include your name, testimonial location, and contact information.</span></p>\r\n                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Deliver targeted advertising to you : We may use your information to develop and display content and advertising (and work with third parties who do so) tailored to your interests and/or location and to measure its effectiveness.</span></p>\r\n                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Administer prize draws and competitions. We may use your information to administer prize draws and competitions when you elect to participate in competitions.</span></p>\r\n                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Request Feedback : We may use your information to request feedback and to contact you about your use of our Services or Offerings.</span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To protect our Services : We may use your information as part of our efforts to keep our Services or Website safe and secure (for example, for fraud monitoring and prevention).</span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To enable user-to-user communications : We may use your information in order to enable user-to-user communications with each users consent.</span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To enforce our terms, conditions and policies for Business Purposes, Legal Reasons and Contractual.</span></p>\r\n                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To respond to legal requests and prevent harm : If we receive a subpoena or other legal request, we may need to inspect the data we hold to determine how to respond.</span></p>\r\n                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To manage user accounts : We may use your information for the purposes of managing our account and keeping it in working order.</span></p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To deliver services to the user : We may use your information to provide you with the requested service.</span></p>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">To respond to user inquiries/offer support to users : We may use your information to respond to your inquiries and solve any potential issues you might have with the use of our Services.</span></p>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">For other Business Purposes : We may use your information for other Business Purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Services or Offerings, Products, Marketing and your experience. We may use and store this information in aggregated and anonymized form so that it is not associated with individual end users and does not include personal information. We will not use identifiable personal information without your consent.</span></p>\r\n                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                        <h3 xss=\"removed\"><span xss=\"removed\">3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</span></h3>\r\n                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">In Short : We only share information with your consent, to comply with laws, to provide you with services, to protect your rights, or to fulfill business obligations. If needed, otherwise we only use the data for our own marketing purposes.</span></p>\r\n                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We may process or share data based on the following legal basis :</span></p>\r\n                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Consent : We may process your data if you have given us specific consent to use your personal information for a specific purpose.</span></p>\r\n                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Legitimate Interests : We may process your data when it is reasonably necessary to achieve our legitimate business interests.</span></p>\r\n                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Performance of a Contract : Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.</span></p>\r\n                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Legal Obligations : We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).</span></p>\r\n                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Vital Interests : We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.</span></p>\r\n                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">More specifically, we may need to process your data or share your personal information in the following situations :</span></p>\r\n                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Vendors, Consultants and Other Third-Party Service Providers : We may share your data with third party vendors, service providers, contractors or agents who perform services for us or on our behalf and require access to such information to do that work.</span></p>\r\n                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Examples include : payment processing, data analysis, email delivery, hosting services, customer service and marketing efforts. We may allow selected third parties to use tracking technology on the Services, which will enable them to collect data about how you interact with the Services over time. This information may be used in, among other things, such as analyze and track data, determine the popularity of certain content and better understand online activity. Unless described in this Policy, we do not share, sell, rent or trade any of your information with third parties for their promotional purposes.</span></p>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Business Transfers : We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.</span></p>\r\n                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Third-Party Advertisers : We may use third-party advertising companies to serve ads when you visit the Services or Offerings. These companies may use information about your visits to our Website(s) and other websites that are contained in web cookies and other tracking technologies in order to provide advertisements about goods and services of interest to you.</span></p>\r\n                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Affiliates : We may share your information with our affiliates, in which case we will require those affiliates to honor this privacy policy. Affiliates include our parent company and any subsidiaries, joint venture partners or other companies that we control or that are under common control with us.</span></p>\r\n                                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Business Partners : We may share your information with our business partners to offer you certain products, services or promotions.</span></p>\r\n                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Other Users : When you share personal information (for example, by posting comments, contributions or other content to the Services) or otherwise interact with public areas of the Services, such personal information may be viewed by all users and may be publicly distributed outside the Services or Apps in perpetuity. If you interact with other users of our Services and register through a social network (such as Facebook or others), your contacts on the social network will see your name, profile photo, and descriptions of your activity. Similarly, other users will be able to view descriptions of your activity, communicate with you within our Services, and view your profile.</span></p>\r\n                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Offer Wall : Our websites may display a third-party hosted offer wall. Such an offer wall allows third-party advertisers to offer virtual currency, gifts, or other items to users in return for acceptance and completion of an advertisement offer. Such an offer wall may appear in our mobile or web browser and be displayed to you based on certain data, such as your geographic area or demographic information. When you click on an offer wall, you will leave our mobile or web browser. A unique identifier, such as your user ID, will be shared with the offer wall provider in order to prevent fraud and properly credit your account.</span></p>\r\n                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                    <h3 xss=\"removed\"><span xss=\"removed\">4. DO WE USE COOKIES AND OTHER TRACKING TECHNOLOGIES?</span></h3>\r\n                                                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">In Short: We may use cookies and other tracking technologies to collect and store your information.</span></p>\r\n                                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We may use cookies and similar tracking technologies (like web beacons and pixels) to access or store information. Specific information about how we use such technologies and how you can refuse certain cookies is set out in our Cookie Policy.</span></p>\r\n                                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                <h3 xss=\"removed\"><span xss=\"removed\">5. HOW DO WE HANDLE YOUR SOCIAL LOGINS?</span></h3>\r\n                                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">In Short: If you choose to register / signup or login to our services using a social media account, we may have access to certain information about you.</span></p>\r\n                                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We will use the information we receive only for the purposes that are described in this privacy policy or that are otherwise made clear to you on the Services or Websites. Please note that we do not control, and are not responsible for, other uses of your personal information by your third party social media provider. We recommend that you review their privacy policy to understand how they collect, use and share your personal information, and how you can set your privacy preferences on their sites and apps.</span></p>\r\n                                                                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                        <h3 xss=\"removed\"><span xss=\"removed\">6. WHAT IS OUR STANCE ON THIRD-PARTY WEBSITES?</span></h3>\r\n                                                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">In Short: We are not responsible for the safety of any information that you share with third-party providers who advertise, but are not affiliated with, our websites.</span></p>\r\n                                                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The Services may contain advertisements from third parties that are not affiliated with us and which may link to other websites, online services or mobile applications. We cannot guarantee the safety and privacy of data you provide to any third parties. Any data collected by third parties is not covered by this privacy policy. We are not responsible for the content or privacy and security practices and policies of any third parties, including other websites, services or applications that may be linked to or from the Services or Apps. You should review the policies of such third parties and contact them directly to respond to your questions.</span></p>\r\n                                                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                                    <h3 xss=\"removed\"><span xss=\"removed\">7. HOW LONG DO WE KEEP YOUR INFORMATION?</span></h3>\r\n                                                                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">In Short: We keep your information for as long as necessary to fulfill the purposes outlined in this privacy policy unless otherwise required by the law.</span></p>\r\n                                                                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We will only keep your personal information for as long as it is necessary for the purposes set out in this privacy policy, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). No purpose in this policy will require us keeping your personal information for longer than the period of time in which users have an account with us.</span></p>\r\n                                                                                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">When we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize it, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible.</span></p>\r\n                                                                                                                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                                                                                                                    <h3 xss=\"removed\"><span xss=\"removed\">8. HOW DO WE KEEP YOUR INFORMATION SAFE?</span></h3>\r\n                                                                                                                                                                           